import time
def a(s,words):
    if words == [] or s == '':
        return []

    def b(l2, words, i, li, len1, x):
        # l2 = l.copy()
        for n in range(len(l2)):
            if words[x:len(words)].startswith(l2[n]):
                x += len(l2[0])
                l2.pop(n)
                if l2 == []:
                    li.append(i)
                    # return True
                else:
                    b(l2, words, i, li, len1, x)
                    break
        del l2

    l1 = len(s)
    len2 = len(words) * len(words[0])
    step = l1 - len2
    # w=len(words[0])
    li = []
    i = 0
    list1=[]
    list2=[]
    while i <= step + 1:
        l2 = words.copy()
        f = s[i:len2 + i]

        if f in list1:
            m = list1.index(f)
            list1.append(f)
            if list2[m] == None:
                list2.append(None)
            else:

                list2.append(list2[m]+i)
                li.append(i)
        else:
            list1.append(f)
            x = 0
            b(l2, f, i, li, len2, x)
            if li:
                if li[len(li) - 1] == i:
                    list2.append(i)
                else:
                    list2.append(None)
            else:
                list2.append(None)
        i += 1

    return li
